import React from 'react';
import {Helmet} from 'react-helmet'
import logo from '../assents-img/logo.svg'

class Navbar extends React.Component {
    render() {
        return (

            <React.Fragment>
                <ul><img src={logo} alt=""/></ul>
            </React.Fragment>
        );
    }
}

export default Navbar;
